import React from "react";
import "./home.css";
import image from "./public/logo192.jpg";
import { dialogClasses } from "@mui/material";
import Product from "./product";

function home() {
  return (
    <div className="home">
      <div className="home_container">
        <img className="home_image" src={image} alt="" />
      </div>
      <div className="home_row">
        {/* 2 products*/}
        <Product />
        <Product />
      </div>

      <div className="home_row">{/* 3 products*/}</div>

      <div className="home_row">{/* 1 products*/}</div>
    </div>
  );
}

export default home;
